import React, { Component } from 'react'; 
import './App.css';

const list = [
  {
    title: 'React',
    url: 'https://reactjs.org/', 
    author: 'Jordan Walke',
    num_commets: 3,
    points: 4, 
    objectID: 0
  },
  {
    title: 'Redux',
    url: 'https://redux.js.org/',
    author: 'Dan Abramov, Andrew Clark',
    num_commets: 2, 
    points: 5, 
    objectID: 1,
  },
];

class App extends Component { 
  render() {
    const title = 'Juan\'s To-Do List';
    return (
      <div className="App">
        <h2> {title} </h2>
        {list.map(function(item) {
          return <div> {item.title} </div>
        })}
      </div>
    ); 
  }
}

export default App;
